import { apiIsBoughtMatchTicket, apiIsCanBuyMatchTicket } from "../api/match.js";
import back from "../components/Botton/back.vue";
export default {
  components: {
    back: back
  },
  created: function created() {
    this.getrender();
  },
  methods: {
    // 是否买过票
    getIsMatchticket: function getIsMatchticket(id, name) {
      var _this = this;

      var data = {
        matchId: id
      };
      this.$store.commit("upMatchid", {
        MatchId: id,
        MatchName: name
      });
      apiIsCanBuyMatchTicket(data, true).then(function (res) {
        if (Math.abs(res.Code) >= 600 || res.IsCanBuyMatchTicket == false) {
          // this.$router.push(`/rankticket/${id}`);
          var m = _this.$message({
            type: "error",
            duration: 3000,
            message: res.Message,
            center: true
          });

          setTimeout(function () {
            return m.close();
          }, 1200);
        } else {
          // this.gojump(id, name);
          _this.$router.push("/rankticket/".concat(id));
        }
      });
    },
    gojump: function gojump(id, name) {
      this.$store.commit("upMatchid", {
        MatchId: id,
        MatchName: name
      });
      this.$router.push("/rankmatch");
    },
    getrender: function getrender() {
      this.$store.dispatch("asyncGetHistoryMatchList");
    }
  }
};
